const list = { hidden: { opacity: 0 } }
const item = { hidden: { x: -10, opacity: 0 } }

function Projects (){
    return (
        <motion.div
        animate={{ scale: 2 }}
        transition={{ duration: 0.5 }
        }
      />
);
}
export default Projects;
